// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;

import "./RoleManager.sol";

contract Repository is RoleManager("Administrator"){
    event VersionAdded(address committer, string versionName, uint256 timestamp);
    event RepositoryCreated(string name, uint256 createdAt, address owner, string description);

    string public name;
    uint256 public createdAt;
    address public owner;
    string public description;
    bool public toReview;

    struct Version {
        uint256 timestamp;
        address committer;
        string commitName;
    }

    struct Milestone {
        uint256 timestamp;
        address committer;
        string name;
    }

    mapping(bytes32 => Version) public version;
    bytes32[] public versionHashes;

    constructor(string memory _name, string memory _description) {
        name = _name;
        createdAt = block.timestamp;
        owner = msg.sender;
        description = _description;
        toReview = false;
        emit RepositoryCreated(_name, createdAt, owner, _description);
    }

    function addVersionOfRepository(string memory _name) public
        onlyRole(CONTRIBUTOR_ROLE)
    {
        bytes32 versionHash;
        versionHash = keccak256(abi.encodePacked(msg.sender, block.timestamp));
        Version storage newVersion = version[versionHash];
        newVersion.timestamp = block.timestamp;
        newVersion.committer = msg.sender;
        newVersion.commitName = _name;
        versionHashes.push(versionHash);
        emit VersionAdded(msg.sender, _name, block.timestamp);
    }

    function setToReview(bool _toReview) public {
        toReview = _toReview;
    }


}

contracts/RepositoryFactory.sol.content:
// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;

import "./Repository.sol";

contract RepositoryFactory {
    event NewRepositorySet(string name, uint256 createdAt, address owner, Repository repository);

    Repository[] public repositories;
    uint256 public userCounter;

    struct User {
        uint id;
        Repository[] listOfRepositories;
    }

    struct Review {
        address repository;
        address reviewer;
        uint reviewerSkillLevel;
        bytes32 contentIdentifier;
        bytes32 versionId;
    }

    mapping(address => uint[]) internal repositoryReview;
    mapping(address => uint[]) internal reviewerReview;
    mapping(address => User) internal usersData;
    address[] public users;
    Review[] public reviews;

    function createRepositoryContract(string memory _name, string memory _description) public {
        if (usersData[msg.sender].id == 0) {
            userCounter++;
            usersData[msg.sender].id = userCounter;
            users.push(msg.sender);
        }
        Repository repository = new Repository(_name, _description);
        repositories.push(repository);
        usersData[msg.sender].listOfRepositories.push(repository);
        emit NewRepositorySet(_name, block.timestamp, msg.sender, repository);
    }


    function getUserReviewScore(address user) external view returns (uint) {
        return reviewerReview[user].length;
    }


    function getUserRepos(address user) external view returns (Repository[] memory) {
        return usersData[user].listOfRepositories;
    }

    function getUsers() external view returns (address[] memory) {
        return users;
    }
}

